◆WEB限定先行販売<br>

・iPhone 7 Plus用のICカードポケット付きケースです。<br>
・iPhone 6s Plus, iPhone 6 Plusでもご使用いただけます。<br>
・防磁シート付きなのでケースにカードを入れたまま改札で使用できます。<br>
・ケースのボタンを押すと、ICカードポケットに入れた電子マネーの残高を表示します。<br>
・ケースを改札にかざすと、自動的に一定時間残高を表示します。<br>
・nanacoは残高とポイントを表示します。<br>
・ケースをつけた状態でApple Payをご利用いただけます。
・nocoly Airは、実機(iPhone)に装着してご使用下さい。装着しないとカードが読み取れない場合がございます。
・カードの経年劣化及びカードが凹んでいたり曲がっていると読み取れない場合がございます。
・nanaco のポイントは１年以内に失効するポイントがある場合、１年以内に失効するポイント残高が表示されます。<!--ポイント背景-->

